"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[4543],{4543:s=>{s.exports=JSON.parse('{"lessonId":"A2_U19","title":"\u0423\u0440\u043e\u043a 19: m\xedo, tuyo, suyo... (\u041f\u0440\u0438\u0442\u044f\u0436\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u043c\u0435\u0441\u0442\u043e\u0438\u043c\u0435\u043d\u0438\u044f 2)","level":"A2","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u041f\u0440\u0438\u0442\u044f\u0436\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u043c\u0435\u0441\u0442\u043e\u0438\u043c\u0435\u043d\u0438\u044f-\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 (\u043f\u043e\u043b\u043d\u0430\u044f \u0444\u043e\u0440\u043c\u0430)","content":[{"text":"<strong>M\xedo, tuyo, nuestro</strong> \u0438 \u0434\u0440\u0443\u0433\u0438\u0435 \u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u043f\u0440\u0438\u0442\u044f\u0436\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u043c\u0438 \u043c\u0435\u0441\u0442\u043e\u0438\u043c\u0435\u043d\u0438\u044f\u043c\u0438. \u041e\u043d\u0438 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044e\u0442\u0441\u044f \u0434\u043b\u044f \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044f \u043d\u0430 \u0432\u043b\u0430\u0434\u0435\u043d\u0438\u0435 \u0438\u043b\u0438 \u0434\u0440\u0443\u0433\u0438\u0435 \u0442\u0438\u043f\u044b \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0439 \u0441 \u043b\u044e\u0434\u044c\u043c\u0438, \u0436\u0438\u0432\u043e\u0442\u043d\u044b\u043c\u0438 \u0438\u043b\u0438 \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u0430\u043c\u0438."},{"list":["<i>\u2013Mi madre trabaja en un banco. \xbfY <strong>la tuya</strong>? \u2013<strong>La m\xeda</strong> trabaja en una agencia de viajes.</i>","<i>\u2013Mi pueblo es muy bonito y moderno. \u2013<strong>El nuestro</strong> es muy antiguo.</i>"]}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0424\u043e\u0440\u043c\u044b \u043f\u0440\u0438\u0442\u044f\u0436\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u043c\u0435\u0441\u0442\u043e\u0438\u043c\u0435\u043d\u0438\u0439","content":[{"table":{"headers":["\u0412\u043b\u0430\u0434\u0435\u043b\u0435\u0446","SINGULAR (\u0435\u0434.\u0447.)","PLURAL (\u043c\u043d.\u0447.)"],"rows":[["","<strong>MASCULINO</strong>","<strong>FEMENINO</strong>","<strong>MASCULINO</strong>","<strong>FEMENINO</strong>"],["yo","m\xedo","m\xeda","m\xedos","m\xedas"],["t\xfa","tuyo","tuya","tuyos","tuyas"],["usted<br>\xe9l, ella","suyo","suya","suyos","suyas"],["nosotros, -as","nuestro","nuestra","nuestros","nuestras"],["vosotros, -as","vuestro","vuestra","vuestros","vuestras"],["ustedes<br>ellos, ellas","suyo","suya","suyos","suyas"]]}},{"text":"<strong>1. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044e\u0442\u0441\u044f `ser` + `m\xedo, tuyo`..., \u0447\u0442\u043e\u0431\u044b \u0432\u044b\u0440\u0430\u0437\u0438\u0442\u044c \u0432\u043b\u0430\u0434\u0435\u043d\u0438\u0435.</strong><br><i>Esta bolsa no es <strong>m\xeda</strong>. \xbfEs <strong>tuya</strong>, Amparo?<br>\u2013\xbfEs esto <strong>nuestro</strong>? \u2013No, es <strong>suyo</strong>.</i>"},{"text":"<strong>2. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044e\u0442\u0441\u044f `el, la, los, las` + `m\xedo, tuyo`..., \u043a\u043e\u0433\u0434\u0430 \u0440\u0435\u0447\u044c \u0438\u0434\u0435\u0442 \u043e \u043a\u043e\u043c-\u0442\u043e \u0438\u043b\u0438 \u0447\u0435\u043c-\u0442\u043e, \u0443\u043f\u043e\u043c\u044f\u043d\u0443\u0442\u043e\u043c \u0440\u0430\u043d\u0435\u0435.</strong><br><i>\u2013\xbfEs esta tu bolsa? \u2013No, <strong>la m\xeda</strong> es m\xe1s peque\xf1a.<br>Como se estrope\xf3 el coche de Jaime, fuimos en <strong>el nuestro</strong>.</i>"},{"text":"<strong>3. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044e\u0442\u0441\u044f `un, una, unos, unas` + \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0435 + `m\xedo, tuyo`..., \u043a\u043e\u0433\u0434\u0430 \u0440\u0435\u0447\u044c \u0438\u0434\u0435\u0442 \u043e \u043a\u043e\u043c-\u0442\u043e \u0438\u043b\u0438 \u0447\u0435\u043c-\u0442\u043e \u0438\u0437 \u0433\u0440\u0443\u043f\u043f\u044b.</strong><br><i>\u2013\xbfConoces a Juli\xe1n? \u2013S\xed, hombre. Es <strong>un amigo m\xedo</strong>. (Es uno de mis amigos.)<br><strong>Una t\xeda nuestra</strong> vive en Panam\xe1. (una de nuestras t\xedas)</i>"},{"text":"<strong>ATENCI\xd3N:</strong><br>\u0424\u043e\u0440\u043c\u044b `suyo, suya, suyos, suyas` \u043c\u043e\u0433\u0443\u0442 \u0438\u043c\u0435\u0442\u044c \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0439. \u0414\u043b\u044f \u0443\u0442\u043e\u0447\u043d\u0435\u043d\u0438\u044f \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044e\u0442\u0441\u044f \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438 `de \xe9l, de ella, de usted, de ellos, de ellas, de ustedes`.<br><i>\u2013\xbfSon estas las maletas de Felisa? \u2013No, <strong>las suyas</strong> son azules. (las de Felisa)<br>\u2013\xbfSon estas mis maletas? \u2013No, <strong>las suyas</strong> son m\xe1s peque\xf1as. (las de usted)</i>"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 19.1: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u043a\u0430\u043a \u0432 \u043f\u0440\u0438\u043c\u0435\u0440\u0435","tasks":[{"id":"u19_1_1","sentence":"1. \xbfDe qui\xe9n son estas llaves? \u2192 Son ___.","answer":"m\xedas"},{"id":"u19_1_2","sentence":"2. \xbfDe qui\xe9n es este libro? \u2192 Es ___.","answer":"tuyo"},{"id":"u19_1_3","sentence":"3. \xbfDe qui\xe9n es este paraguas? \u2192 Es ___.","answer":"suyo"},{"id":"u19_1_4","sentence":"4. \xbfDe qui\xe9n son estos CD? \u2192 Son ___.","answer":"nuestros"},{"id":"u19_1_5","sentence":"5. \xbfSon estos libros? \u2192 Son ___.","answer":"vuestros"},{"id":"u19_1_6","sentence":"6. \xbfSon estas maletas? \u2192 Son ___.","answer":"suyas"},{"id":"u19_1_7","sentence":"7. \xbfEs este reloj? \u2192 Es ___.","answer":"m\xedo"},{"id":"u19_1_8","sentence":"8. \xbfEs esta bufanda? \u2192 Es ___.","answer":"tuya"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 19.2: \u041d\u0430\u043f\u0438\u0448\u0438\u0442\u0435 m\xedo, la tuya, los suyos... \u0441\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0438","tasks":[{"id":"u19_2_1","sentence":"1. Estas llaves no son m\xedas. Las ___ son m\xe1s peque\xf1as.","answer":"m\xedas"},{"id":"u19_2_2","sentence":"2. \u2013\xbfEs ese vuestro coche? \u2013No, ___ es m\xe1s grande.","answer":"el nuestro"},{"id":"u19_2_3","sentence":"3. Este abrigo no es de Pedro. ___ es azul.","answer":"El suyo"},{"id":"u19_2_4","sentence":"4. \u2013Perdona, \xbfes este mi asiento? \u2013No, ___ est\xe1 m\xe1s atr\xe1s.","answer":"el suyo"},{"id":"u19_2_5","sentence":"5. \u2013\xbfEs ese nuestro profesor? \u2013No, ___ es mayor.","answer":"el vuestro"},{"id":"u19_2_6","sentence":"6. \u2013Mi deporte preferido es el f\xfatbol. \xbfY ___? \u2013___ es el esqu\xed.","answer":"el tuyo, El m\xedo"},{"id":"u19_2_7","sentence":"7. \u2013Mis hijos practican muchos deportes. \xbfY ___? \u2013___ juegan al tenis.","answer":"los tuyos, Los m\xedos"},{"id":"u19_2_8","sentence":"8. \u2013\xbfSon esos los padres de Arturo? \u2013No, ___ son m\xe1s j\xf3venes.","answer":"los suyos"},{"id":"u19_2_9","sentence":"9. \u2013Mi profesora es peruana. \u2013___ es argentina.","answer":"La m\xeda"},{"id":"u19_2_10","sentence":"10. \u2013Nuestros hijos son muy trabajadores. \u2013___ son un poco vagos.","answer":"Los nuestros"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 19.3: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0441 m\xedo, tuyo, suyo... \u0438 un, una, unos, unas, \u0435\u0441\u043b\u0438 \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e","tasks":[{"id":"u19_3_1","sentence":"1. (amigo, yo) <u>Un amigo m\xedo</u> es pintor.","answer":"Un amigo m\xedo"},{"id":"u19_3_2","sentence":"2. (amiga, yo) ___ ha ganado un premio.","answer":"Una amiga m\xeda"},{"id":"u19_3_3","sentence":"3. Ayer estuve con (primo, vosotros) ___.","answer":"un primo vuestro"},{"id":"u19_3_4","sentence":"4. El director del banco es (amigo, ellos) ___.","answer":"amigo suyo"},{"id":"u19_3_5","sentence":"5. Raquel es (prima, nosotros) ___.","answer":"prima nuestra"},{"id":"u19_3_6","sentence":"6. \xbfEs Alicia (t\xeda, t\xfa) ___?","answer":"t\xeda tuya"},{"id":"u19_3_7","sentence":"7. \u2013\xbfConoc\xe9is a Mariano? \u2013S\xed, es (amigo, nosotros) ___.","answer":"un amigo nuestro"},{"id":"u19_3_8","sentence":"8. El domingo conocimos a (familiares, ustedes) ___.","answer":"unos familiares suyos"}]}]}')}}]);